import Footer from "./components/Footer/Footer";
import Header from "./components/Header/Header";
import HomePage from "./pages/HomePage";

function App() {
  return (
    <div style={{display: 'flex', flexDirection: 'column', gap: '50px'}}>

      <Header></Header>

      <main>
          <HomePage/>
      </main>


    <Footer/>

      {/* header */}
      {/* main */}
      {/* footer */}
    </div>
  );
}

export default App;
